// Policy to enable mTLS for all services in namespace frod
//
// ```yaml
// apiVersion: authentication.istio.io/v1alpha1
// kind: Policy
// metadata:
//   name: mTLS_enable
//   namespace: frod
// spec:
//   destinations:
//   peers:
//   - mtls: null
// ```
// Policy to disable mTLS for "productpage" service
//
// ```yaml
// apiVersion: authentication.istio.io/v1alpha1
// kind: Policy
// metadata:
//   name: mTLS_disable
//   namespace: frod
// spec:
//   destinations:
//   - name: productpage
//   peers:
// ```
// Policy to enable mTLS, and use JWT for productpage:9000.
//
// ```yaml
// apiVersion: authentication.istio.io/v1alpha1
// kind: Policy
// metadata:
//   name: mTLS_enable
//   namespace: frod
// spec:
//   destinations:
//   - name: productpage
//     port:
//       number: 9000
//   peers:
//   - mtls: null
//   origins:
//   - name: google_jwt
//     jwt:
//       issuer: "https://securetoken.google.com"
//       audiences:
//       - "productpage"
//       jwksUri: "https://www.googleapis.com/oauth2/v1/certs"
//       locations:
//       - header: x-goog-iap-jwt-assertion
//   credentialRules:
//   - binding: USE_ORIGIN
// ```
//
// Policy to enable mTLS, and use JWT for productpage:9000 only when caller is
// frontend.serviceaccount.
//
// ```yaml
// apiVersion: authentication.istio.io/v1alpha1
// kind: Policy
// metadata:
//   name: mTLS_enable
//   namespace: frod
// spec:
//   destinations:
//   - name: productpage
//     port:
//       number: 9000
//   peers:
//   - mtls: null
//   origins:
//   - name: google_jwt
//     jwt:
//       issuer: "https://securetoken.google.com"
//       audiences:
//       - "productpage"
//       jwksUri: "https://www.googleapis.com/oauth2/v1/certs"
//       locations:
//       - header: x-goog-iap-jwt-assertion
//   credentialRules:
//   - binding: USE_ORIGIN
//     matchingSources:
//     - frontend.serviceaccount
//     selected_origin_methods:
//     - "*"
// ```
